// src/App.js

import React, { useState, useEffect } from 'react';
import WeeklyTimeScatter from './components/WeeklyTimeScatter';
import PassRateHistogram from './components/PassRateHistogram';
import EfficiencyTable from './components/EfficiencyTable';
import TeacherComparison from './components/TeacherComparison';
import './App.css';

const App = () => {
  const [data, setData] = useState([]);

  // Mock data or CSV processed data
  useEffect(() => {
    const fetchData = async () => {
      // Simulate CSV data fetching or processing here
      const mockData = [
        { class: 'Class A', teacher: 'Teacher 1', timeSpent: 40, passRate: 85 },
        { class: 'Class B', teacher: 'Teacher 2', timeSpent: 20, passRate: 50 },
        { class: 'Class A', teacher: 'Teacher 1', timeSpent: 45, passRate: 90 },
        { class: 'Class C', teacher: 'Teacher 3', timeSpent: 30, passRate: 70 },
        { class: 'Class D', teacher: 'Teacher 4', timeSpent: 25, passRate: 60 },
        { class: 'Class E', teacher: 'Teacher 5', timeSpent: 50, passRate: 95 },
      ];
      setData(mockData);
    };

    fetchData();
  }, []);

  return (
    <div className="App">
      <h1>Middle School Intervention Data</h1>

      {/* Scatterplot for Weekly Time Spent vs Pass Rate */}
      <h2>Time Spent vs Pass Rate</h2>
      <WeeklyTimeScatter data={data} />

      {/* Histogram for Pass Rate Distribution */}
      <h2>Pass Rate Distribution</h2>
      <PassRateHistogram data={data} />

      {/* Table for Efficiency Metrics */}
      <h2>Efficiency Table</h2>
      <EfficiencyTable data={data} />

      {/* Comparison of Teachers */}
      <h2>Teacher Performance Comparison</h2>
      <TeacherComparison data={data} />
    </div>
  );
};

export default App;
